import React from 'react'

export default class Square extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            value: null
        }
    }

    render() {
        return (
            <button className="square" onClick={ () => alert('click on ' + this.state.value) } >
                {this.props.value}
            </button>
        )
    }
}
